import React from 'react'
import './mycss.css'
import './creative.min.css'
import LogoComponent from './logo/LogoComponent'
import AboutContainer from './about/AboutContainer'
import {Route,NavLink, Switch } from 'react-router-dom'

class HeaderComponent extends React.Component{
    state = {
        userid : 56789
    }

    //function clickevent
    clickevent = () =>{
    alert("Data deleted")
}

   //function updateEvent
    updateEvent = () =>{
        this.setState({userid : 99999})
    }

    render(){
        return(

          
            <nav class="navbar custom-nav-bar navbar-expand-lg navbar-light fixed-top py-3" id="mainNav">
       
       
          <div class="container">
            <h1>Register</h1>
            <p>Please fill in this form to create an account.</p>
            <br></br>
        
            <label for="email"><b>Email</b></label>
            <input type="text" placeholder="Enter Email" name="email" required></input>
            <br></br>
        
            <label for="psw"><b>Password</b></label>
            <input type="password" placeholder="Enter Password" name="psw" required></input>
            <br></br>
            
            <label for="psw-repeat"><b>Repeat Password</b></label>
            <input type="password" placeholder="Repeat Password" name="psw-repeat" required></input>
            <br></br>
        
            <p>By creating an account you agree to our <a href="#">Terms and Privacy</a></p>
            <button type="submit" class="registerbtn">Register</button>
          </div>
        
          <div class="container signin">
            <p>Already have an account? <a href="#">Sign in</a>.</p>
          </div>
      
          </nav>
   
        )
     
        
       
    }
}


export default HeaderComponent
